import React from "react";
import InformationCard from "./InformationCard";
import { faHeartPulse, faTruckMedical, faTooth } from "@fortawesome/free-solid-svg-icons";
import "../Styles/Info.css";

function Info() {
  return (
    <div className="info-section" id="services">
      <div className="info-title-content">
        <h3 className="info-title">
          <span>What We Do</span>
        </h3>
        <p className="info-description">
        Prevent Employee Fraud: Stop Advance Scams by Tracking Verified Employee Networks.
        Our secure platform empowers business owners to build trust with their
        workforce and eliminate the risk of fraudulent advances.
        </p>
      </div>

      <div className="info-cards-content">
        <InformationCard
          title="Prevent Employee Fraud"
          description="Stop Advance Scams by Tracking Verified Employee Networks. 
          Our secure platform empowers business owners to build trust with
          their workforce and eliminate the risk of fraudulent advances."
          // icon={faTruckMedical}
        />

        <InformationCard
          title="Employee management"
          description="Our team of experienced cardiologists and medical experts use
            state-of-the-art technology to assess your cardiovascular health and
            design personalized treatment plans. From comprehensive screenings
            to advanced interventions, we are committed to helping you maintain
            a healthy heart and lead a fulfilling life."
          // icon={faHeartPulse}
        />

        <InformationCard
          title="Business Sales Insight"
          description="Smile with confidence as our Dental Care services cater to all your
            oral health needs. Our skilled dentists provide a wide range of
            treatments, from routine check-ups and cleanings to cosmetic
            procedures and restorative treatments."
          icon={faTooth}
        />
      </div>
    </div>
  );
}

export default Info;
